import React from "react";

class CP extends React.Component {
    render() {
        return (

            <body>

                <div class="w3-container w3-xlarge w3-green w3-shadow w3-hide-small">
                     <div class="w3-center"><h1 style="margin-top:30px;margin-bottom:20px;">Choose a country recipe page</h1></div>
                </div>


                
            </body>
        );
    }
}

export default CP;
